Enables the output of contract metadata. The metadata is a JSON object that contains information about the contract, such as its name, source code hash, the list of dependencies, compiler versions, and so on. The zksolc metadata format is compatible with the Solidity metadata format . This means that the metadata output can be used with other tools that support Solidity metadata. Essentially, solc metadata is a part of zksolc metadata, and it is included as source_metadata without any modifications. Usage: zksolc Simple.sol --metadata Output: ======= Simple.sol:Simple =======
Metadata:
{"llvm_options":[],"optimizer_settings":{"is_debug_logging_enabled":false,"is_fallback_to_size_enabled":false,"is_verify_each_enabled":false,"level_back_end":"Aggressive","level_middle_end":"Aggressive","level_middle_end_size":"Zero"},"solc_version":"<masked>","solc_zkvm_edition":null,"source_metadata":{...},"zk_version":"<masked>"}

29.body:
Enables the linker mode. zksolc includes an LLVM-based linker that can be used for post-compile-time linking of libraries. The linker features its own minimal JSON output format: Field Description linked Bytecode files where all library references have been successfully resolved. Values are hashes of the bytecode used to identify EraVM dependencies during deployment unlinked If empty, the bytecode in the file ./output/Greeter.sol/Greeter.zbin is ready for deployment. The bytecode file is modified in-place, so the original file with unlinked bytecode is overwritten. If not empty, some symbols are left unresolved, so the linker must be called again. ignored Bytecode files already linked before, so they were not processed by the linker in the current call. Linking is done in several steps: A contract with a library dependency is compiled to bytecode: // SPDX-License-Identifier: Unlicensed pragma solidity ^0.8.0; library GreeterHelper { function addPrefix(Greeter greeter, string memory great) public view returns (string memory) { return string.concat(greeter._prefix(), great); }
} contract Greeter { string public greeting; string public _prefix; constructor(string memory _greeting) { greeting = _greeting; _prefix = "The greating is:"; } function greet() public view returns (string memory) { return GreeterHelper.addPrefix(this, greeting); }
} zksolc './Greeter.sol' --output-dir './output' --bin For unlinked bytecode, the ZKsync compiler toolchain uses an ELF wrapper which is the standard of the LLVM framework. ELF-wrapped bytecode is not a valid bytecode that can be deployed to the blockchain. Before deployment, all library references must be resolved. Upon the resolution of the library references, the ELF wrapper is stripped and only the raw bytecode ready for deployment remains. It also means that unlinked and linked bytecodes are not equal in size. Check for unlinked library references. It can be done with the following command, where the --library argument is intentionally omitted: zksolc --link './output/Greeter.sol/Greeter.zbin' | jq . Output: { "ignored": {}, "linked": {}, "unlinked": { "./output/Greeter.sol/Greeter.zbin": [ "Greeter.sol:GreeterHelper" ] }
} Provide library addresses to the linker. The library addresses must be provided in the --libraries argument: zksolc --link './output/Greeter.sol/Greeter.zbin' --libraries 'Greeter.sol:GreaterHelper=0x1234567812345678123456781234567812345678' | jq . Output: { "ignored": {}, "linked": { "./output/Greeter.sol/Greeter.zbin": "010000bd2bcef5602ae1ebc0b812cc65d88655a8d972ac10227f142e1838093c" }, "unlinked": {}
} If you run the last command above once again, nothing will happen, and the previously linked file will show up as ignored: { "ignored": { "./output/Greeter.sol/Greeter.zbin": "010000bd2bcef5602ae1ebc0b812cc65d88655a8d972ac10227f142e1838093c" }, "linked": {}, "unlinked": {}
}
